import axios from "axios";
import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const LandingPage = () => {
  const [user, setUser] = useState({});

  useEffect(() => {
    axios.get("http://localhost:5000/contract/api/get_user").then((res) => {
      console.log(res);
      // setUser(resp.data);
    });
  }, []);

  return (
    <div>
      <h1>Welcome to collaboration tool</h1>
      {user.length >=1 ? (
        <>
          <h2>Logged in</h2>
          <h3>ID: {user.id}</h3>
          <h3>Email: {user.email}</h3>
        </>
      ) : (
        <>
          <button>
            <Link to="/login">Login</Link>
          </button>
          <button>
            <Link to="/register">Register</Link>
          </button>
        </>
      )}
    </div>
  );
};

export default LandingPage;
